// App.js
import React, { useState } from 'react';
import './App.css';

function App() {
  const [selectedContent, setSelectedContent] = useState('');
  const [results, setResults] = useState({
    battery_status_dict: null,
    gps_status_dict: null,
    accel_status_dict: null,
  });
  const [customerLog, setCustomerLog] = useState(null);

  const handleFileUpload = async (event) => {
    const file = event.target.files[0];
    const formData = new FormData();
    formData.append('ulogFile', file);

    const response = await fetch('http://localhost:5000/process_ulog', {
      method: 'POST',
      body: formData,
    });

    const data = await response.json();
    setResults(data);
  };

  const handleButtonClick = (contentKey) => {
    setSelectedContent(contentKey);
  };

  // Dynamically generate tabs based on results
  const tabs = Object.keys(results).map((key) => (
    <button key={key} onClick={() => handleButtonClick(key)}>
      {key.replace('_', ' ')}
    </button>
  ));

  return (
    <div className="App">
      <div className="top-section">
        <input type="file" onChange={handleFileUpload} />
        <button onClick={fetchResults}>Upload and Process ULog File</button>
      </div>
      <div className="sidebar">
        {tabs}
      </div>
      <div className="content">
        {selectedContent && <div>{JSON.stringify(results[selectedContent])}</div>}
      </div>
    </div>
  );
}

export default App;
